import Hero from '../elements/Hero';
import './home.css';
import { BrowserRouter as NavLink } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import featurebgimg from '../img/featurebgimg.png'
import Features from '../elements/Feature'; 
import FeaturesItem from '../elements/FeaturesItem';

function Home(props) {
  const featurebg = {
    backgroundImage:`url(${featurebgimg})`
  }
    return <>
      <Helmet>
            <title>Whoyoutone</title>
            <meta name="title" content="" />
            <meta name="keywords" content=""></meta>
            <meta name="description" content="" />
            <link rel="canonical" href="#" />
        </Helmet>
         <Hero />
        <div className='FeatureBlock' style={featurebg}>
          <div className='container'>
             <div className='row'>
               <div className='col-md-12 text-center'>
                  <h2>Features</h2>
                  <p>The full monty spiffing good time no biggie cack grub fantastic.</p>
               </div>
             </div>
             <div className='row'>
              {FeaturesItem.map((e)=>{
                return (
                <Features Featuresimg={e.Featuresimg} TitleName={e.TitleName} Decription={e.Decription}/>
              );})}
             </div>
          </div>
        </div>
     </>

} 
export default Home;
